Action.Str:
// Turn arguments into local variables
const args = JSON.parse(task_arguments);

for (const name in args) {
    const value = args[name];
    setLocal(name, value);
}

// Find %task_name                             .        

const descriptionsString = global("ChatGPTTaskDescriptions");
const descriptions = JSON.parse(descriptionsString);
const matching = descriptions.find(description=>description.name == function_name);
if(matching){
    var task_name = matching.taskerName;
}

var contents = [];

for(var idx = 1; idx <= len; idx++){
 let row = [];
 let name = local("acname"+idx)
 let nickname = local("acnickname"+idx)
 let notes = local("acnotes"+idx)
 let number = local("acnumber"+idx)

 if(name)
   row.push(`(Name:${name})`);

 if(nickname && nickname != ' ')
   row.push(`(Nickname:${nickname})`);

 if(number)
   row.push(`(Number:${number})`);

 if(notes)
   row.push(`(Notes:${notes})`);


 contents.push(row.join(', '));
}

contents = contents.join("\n");
